    "# **Google Data Analytics Capstone Project**\n",
    "## **April 2023 Cyclistic Bikeshare data**\n",
    "\n",
    "### Business task\n",
    "Cyclistic has entrusted me with the responsibility of formulating marketing strategies focused on transitioning casual riders into annual members. To effectively accomplish this goal, it's imperative to gain a comprehensive understanding of the distinctions between annual members and casual riders, identify the motivations behind casual riders purchasing a membership, and evaluate the impact of digital media on potential marketing approaches.\n",
    "\n",
    "The ride share data was gotten from Divvy bike share data uploaded to [Divvy trip data](https://divvy-tripdata.s3.amazonaws.com/index.html)\n",
    "\n",
    "### Preparation and Processing \n",
    "I decided to use Microsoft Excel for my analysis and visualisation for simplicity.\n",
    "I began by preparing the data, which involved cleaning and processing it, following these steps:\n",
    "\n",
    "1. I introduced new columns to display the ride duration, indicating the elapsed time from the start to the end of each ride.\n",
    "\n",
    "2. Additionally, I created another column to record the days of the week when each ride occurred, providing insights into the days with the highest bike usage.\n",
    "\n",
    "3. To ensure data accuracy, I removed duplicates from the ride ID column, as it served as the sole unique identifier.\n",
    "\n",
    "4. I eliminated rows with incomplete or missing data to maintain data integrity and consistency.\n",
    "\n",
    "5. Furthermore, I streamlined the dataset by removing unnecessary columns, such as latitude and longitude, which were not pertinent to the analysis.\n",
    "\n",
    "### A summary of my analysis and findings\n",
    "In my analysis, I utilized Power Pivot to perform calculations and derive valuable insights related to user types, ride lengths, maximum ride durations, bike types, and total rides per user type. Here's a summary of my findings based on the calculations:\n",
    "\n",
    "**Mean Ride Length per User Type**: I calculated and compared the average ride duration for different user types. This metric provides a clear understanding of how long casual riders and annual members use the bikes during each ride on average.\n",
    "![Average per user.jpg](attachment:038cdba5-5663-4134-bfbd-ef19392da6ed.jpg)\n",
    "Casual members spend approximately **27 minutes** per ride on average, while annual members have an average ride duration of around **11 minutes**, signifying that annual members opt for shorter rides.\n",
    "\n",
    "\n",
    "**Maximum Ride per User Type**: By determining the maximum ride duration for each user type, I identified the longest individual rides made by casual riders and \n",
    "annual members. This insight is helpful for understanding the upper limits of ride durations for each group. \n",
    "![max ride vs user.jpg](attachment:93b7105e-b864-4b90-9442-b0c5e09fe9c8.jpg)\n",
    "Casual members enjoy the longest rides throughout the month, with the longest duration being slightly over **18 hours 35 mins**, while annual members have the shortest rides, lasting just a few seconds shy of 1 hour.\n",
    "\n",
    "**Bike Type per User Type**: my analysis involved categorizing the bike types used by casual riders and annual members. This revealed that there are preferences or patterns in terms of which bike types are more popular among different user groups.\n",
    "![bike type per user.jpg](attachment:369dacdf-5a8b-4d6e-95c6-3962b81e40df.jpg)\n",
    "Both annual and casual members used the **electric bike** the most followed by the **classic bike**, while only the casual members used the **docked bike**, the annual members did not use it at all.\n",
    "\n",
    "**Total Rides per User Type**: Calculating the total number of rides for each user type allows I to assess the overall usage patterns. It provides insights into how frequently casual riders and annual members utilize the service. \n",
    "![Total rides per user.jpg](attachment:38fb7af4-d414-4df4-8cec-593b51e1b33f.jpg)\n",
    "With **279305** total rides, annual members take the highest number of rides in total, indicating their more frequent bike usage, albeit for shorter periods, whereas casual users tend to use the bikes the most extensively with **147285** total rides.\n",
    "\n",
    "**Ride Length per Day by User Type**: Using Power Pivot, you computed the average ride length per day for each user type. This metric provides insights into how the average ride duration varies on different days of the week for casual riders and annual members, helping to identify usage patterns throughout the week. \n",
    "![ride per user vs day.jpg](attachment:99c1ac05-9c4b-4ac1-b533-dd5a80c23c53.jpg)\n",
    "On Average, both casual and annual members used the bike for the highest duration on **Saturdays**, and casual used rode for the shortest duration on **Fridays** while \n",
    "annual members rode the shortest on **Mondays**\n",
    "\n",
    "### Recommendations\n",
    "Cyclistic can convert casual riders to annual members by doing the following:\n",
    "1. Reduce the ride time for casual riders and simultaneously increase the pricing for their rides. Meanwhile, annual members will continue to enjoy the existing pricing structure. This strategic adjustment aims to encourage casual riders to seriously consider purchasing an annual membership, which offers unlimited ride time at a more affordable rate.\n",
    "\n",
    "2. Develop personalized marketing campaigns that speak directly to the needs and preferences of casual riders. Highlight the benefits of an annual membership, such as cost savings, convenience, or exclusive perks.\n",
    "\n",
    "3. Consider offering special promotions or incentives, such as discounted annual memberships or bonus ride credits, to encourage casual riders to make the switch.\n",
    "\n",
    "\n"
